import React, { Component } from 'react'

export default class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      what: ' ', 
      where: ' '
    }
  }


  handleChangeWhat = (what) => {
    this.setState({
      what: what
    });
  }
  render() {
    return (
      <div>
        <h1>Locals Only</h1>
        <h3>See what Locals are in to!</h3>
        <form>
          <input 
            type="text" 
            name="what" 
            placeHolder="what?" 
            id="what-search" 
            onChange={
              (what) => this.handleChangeWhat(what)
            }
          />
          <input type="text" name="what" placeHolder="where?" id="where-search" onChange={this.handleChangeWhere}/>
          <input type="button" value="Search" onClick={this.handleOnClick}/>
        </form>
      </div>
    )
  }
}
